        FORTNITE_GIFT_INVENTORY_INFO:
          "Szerezz a k\xf6vetkezőh\xf6z illő felszerel\xe9st: {guardOutfitName}!\n\nM\xe1jus\xa04-től feloldhatod a(z) {rewardName} Discord-szerzem\xe9nyt. Ehhez k\xe9t dolgot tehetsz:\n\nK\xf6zvet\xedtsd \xe9lőben, k\xe9pernyőmegoszt\xe1ssal a Discordon a Fortnite j\xe1t\xe9kot legal\xe1bb 15\xa0percig minimum egy Discord-bar\xe1todnak.\n\nMiut\xe1n 15 percig megosztottad a k\xe9pernyődet egy bar\xe1toddal, aj\xe1nd\xe9kk\xe9nt kapsz egy hivatkoz\xe1st a Be\xe1ll\xedt\xe1sok > Aj\xe1nd\xe9klelt\xe1r men\xfcpontban.\n\nA hivatkoz\xe1sra kattintva bejelentkezhetsz az Epic Games-fi\xf3kodba, \xe9s a Wrap hozz\xe1 lesz adva a Fortnite Lockeredhez!\n\nNincs lehetős\xe9ged a j\xe1t\xe9k k\xf6zvet\xedt\xe9s\xe9re? A Discord-boton kereszt\xfcl el\xe9rhető k\xfcldet\xe9sben is r\xe9szt vehetsz! Első l\xe9p\xe9sk\xe9nt csatlakozz a [hivatalos Fortnite Discord-szerverhez](http://discord.gg/fortnite).\n\nA szerveren l\xe1tni fogsz egy botot, akivel interakci\xf3ba l\xe9phetsz, \xe9s csatlakozhatsz a Discord-k\xfcldet\xe9shez.\n\nMiut\xe1n interakci\xf3ba l\xe9psz a bottal, a rendszer egy olyan oldalra ir\xe1ny\xedt, ahol \xf6sszekapcsolhatod egym\xe1ssal az Epic- \xe9s a Discord-fi\xf3kodat.\n\nAz \xf6sszekapcsolt fi\xf3koknak k\xf6sz\xf6nhetően r\xe9szt vehetsz a k\xfcldet\xe9sben. Ehhez el kell v\xe9gezned egy Discordon, valamint egy Fortnite j\xe1t\xe9kon bel\xfcli feladatot.\n\nMiut\xe1n mindk\xe9t feladatot elv\xe9gezted, a Wrap hozz\xe1 lesz adva a Fortnite Lockeredhez!\n\nA blogbejegyz\xe9s\xfcnkben m\xe9g t\xf6bb r\xe9szletet olvashatsz!\n",
